elements.description:
A component for form.

```
<m2-form metadata="{{ metadata }}" on-success="{{ onSuccess() }}" on-error={{ onError() }}></m2-form>
```
```
context = {
    foo: "foo",
    bar: "bar"
}
metadata = {
    formUrl: "/url-to-send-form",
    title: "Form Title",
    confirm: "Sure to submit?",
    fields: [
      {
        name: "foo",
        label: "foo",
        element: "h2-text",
        required: true,
        editable: true,
        visible: true
      },
      {
        name: "bar",
        label: "bar",
        required: true,
        editable: true,
        visible: true
      },
    ],
};
onSuccess() {
  return (data) => {
    console.log(data);
  };
}
onError() {
  return (err) => {
    console.log(err);
  };
};
```
### metadata定义 (FormMeta)
|字段名|类型|Required|描述|
|:--|:--|:--|:--|
|title|string|是|表单头|
|formUrl|string|是|表单提交的url|
|fields|array.<FieldMeta>|是|字段元数据|
|confirm|string|否|表单提交前确认提示|
|hideSubmitBtn|boolean|否|是否禁用提交按钮|
|responseHandleAs|string|否|请求返回实体处理：text,json,blob,arrayBuffer, formData|
|sendAsSearchParams|boolean|否|请求是否以 URLSearchParams 格式发送
|style|string|否|组件自定义样式|

### [See FieldMeta](https://www.webcomponents.org/element/isuwang/metaui/elements/m2-field)

methods.description:
Listen the value change of all watchFields in context.

```javascript
watch(['foo','bar'], (context, whoChange) => {
    console.log(`${whoChange} changed, newValue = ${context[whoChange]}`);
})
```
When watch() execute, the callback will be invoked to refresh the initial state,
notice that the `whoChange` will be undefined at this invoke.

elements.description:
A magic component, which you can post a form or open a dialog.

```
// Immediately submit a form.
<m2-action context="{{ context }}" metadata="{{ metadata }}"></m2-action>

// Open a m2-dialog
<m2-action context="{{ context }}" metadata="{{ metadata1 }}"></m2-action>

```
```
context = {
  name: "WahsonLeung",
  phone: "15900000000"
}

metadata = {
    actionId: "record-add",
    actionName: "Add Record",
    operType: 1,
    formMeta: {
    formUrl: "/url-to-send-form",
    confirm: "Sure to submit?",
    fields: [
      {
        name: "name",
        label:"Name"
      },
      {
        name: "phone",
        label:"Phone"
      },
    ],
}

metadata1 = {
    actionId: "record-add",
    actionName: "Add Record",
    operType: 2,
    formMeta: {
    formUrl: "/url-to-send-form",
    confirm: "Sure to submit?",
    fields: [
      {
        name: "name",
        label:"Name"
      },
      {
        name: "phone",
        label:"Phone"
      },
    ],
}
```
### metadata定义 (ActionMeta)
|字段名|类型|Required|描述|
|:--|:--|:--|:--|
|actionId|string|是|操作的唯一标识|
|actionName|string|是|操作名，如 “收货”
|group|string|否|操作组，如 “更多”
|operType|number|是|操作类型，1：表单，2.弹窗
|formMeta|FormMeta|是|表单meta
|modelSrc|string|否|弹窗的model请求url
|modelQueryParams|``array.<string>``|否|弹窗的model请求参数
|customAction|Function|否|自定义按钮动作，声明了该字段后，会忽略默认的按钮动作

### [See FormMeta](https://www.webcomponents.org/element/isuwang/metaui/elements/m2-form)

