## A component for table.

```html
<m2-grid metadata="{{ metadata }}" value="{{ value }}"></m2-grid>
```
```
metadata = {
  title: "I am the title!",
  grids: [
    {
      name: "col1",
      label: "Col1"
    },
    {
      name: "col2",
      label: "Col2"
    },
    {
      name: "col3",
      label: "Col3"
    },
    {
      metaType: {
        type: "ACTION"
        },
      name: "actions",
      label: "Actions",
    }
  ],
  actions: {
    "action-1": {
      actionId: "action-1",
      actionName: "Action1",
      operType: 1,
      formMeta: {
        formUrl: "/url-to-send-form",
        confirm: "Sure to submit?",
        fields: [
          {
            name: "name",
            label:"Name"
          },
          {
            name: "phone",
            label:"Phone"
          },
        ],
      }
    },
    "action-2": {
      actionId: "action-2",
      actionName: "Action2",
      operType: 2,
      formMeta: {
        title: "Dialog Title",
        formUrl: "/url-to-send-form",
        confirm: "Sure to submit?",
        fields: [
          {
            name: "name",
            label:"Name",
            visible:true,
            editable:true
          },
          {
            name: "phone",
            label:"Phone",
            visible:true,
            editable:true
          },
        ],
      }
    }
  }
}

value = [
  {
    col1: "foo",
    col2: "bar",
    col3: "foobar",
    actions:["action-1","action-2"]
  },
  {
    col1: "foo",
    col2: "bar",
    col3: "foobar",
    actions:["action-1"]
  },
  {
    col1: "foo",
    col2: "bar",
    col3: "foobar",
    actions:["action-2"]
  },
  {
    col1: "foo",
    col2: "bar",
    col3: "foobar",
    actions:["action-1","action-2"]
  }
]
```
### metadata定义 (GridMeta)
|字段名|类型|Required|描述|
|:--|:--|:--|:--|
|grids|``array.<FieldMeta>``|是|表格单元格元数据|
|actions|``map.<string, ActionMeta>``|是|操作集|
|title|string|否|表格标题|
|editable|boolean|否|是否可编辑|

### [See FieldMeta](https://www.webcomponents.org/element/isuwang/metaui/elements/m2-field)
### [See ActionMeta](https://www.webcomponents.org/element/isuwang/metaui/elements/m2-action)

# 由元数据驱动的增删改查组件
```
<m2-crud metadata="{{ metadata }}"
         key-for-items="rows"
         key-for-page-result="pageResponse.results"
         result-descriptor="[[ _desc() ]]">
</m2-crud>
```
```
_desc() {
    return (result) => {
        result.rows[0].name = 'foo';
        return result;
    };
}

metadata = {
    query: {
        FormMeta & {
            noPaging: Boolean     //  是否禁止分页
        }
    },
    actions: {{Array<Action>}},
    result: {{GridMeta}}
}
```
### metadata定义 (DomainMeta)
|字段名|类型|Required|描述|
|:--|:--|:--|:--|
|query|FormMeta|是|表格数据请求表单的元数据|
|actions|``array.<ActionMeta>``|是|针对domain上的操作元数据
|result|GridMeta|是|表格的元数据|

### [See FormMeta][1]
### [See ActionMeta][2]
### [See GridMeta][3]

[1]: https://www.webcomponents.org/element/isuwang/metaui/elements/m2-form
[2]: https://www.webcomponents.org/element/isuwang/metaui/elements/m2-action
[3]: https://www.webcomponents.org/element/isuwang/metaui/elements/m2-grid

